import React from "react";
import Tilt from "react-parallax-tilt";


function Logo() {
  return (
    <div className="ma4">
      <Tilt
        className="Tilt"
        options={{ max: 25 }}
        style={{ height: 250, width: 150 }}
      >
        <div className="Tilt-inner"> SmartBrain </div>
      </Tilt>
    </div>
  );
}

export default Logo;
